module lenet_TB ();

reg [32*32*16-1:0] input_ANN; 

reg clk, reset;
wire [3:0] output_ANN;
reg [5*5*6*16-1:0] Conv1F;
reg [400-1:0] memory1 [0:6-1];
reg [5*5*6*16*16-1:0] Conv2F;
reg [5*5*6*16-1:0] memory2 [0:16-1];

integer i;
integer code;
integer fd ;

localparam PERIOD = 100;

always
	#(PERIOD/2) clk = ~clk;

initial begin
  
    #0
    clk = 1'b0;
    reset = 1'b1;
    
//     label:1
//    input_ANN = 16384';
//     label:8
    input_ANN = 16384';
  
   
    fd = $fopen("C:/Users/24857/Desktop/try/para/layer1.txt", "r");
    for (i=0; i<6; i=i+1) begin
       code = $fscanf(fd, "%h", memory1[i]);
    end
    for (i = 0; i < 6; i = i + 1) begin
            Conv1F[i*5*5*16+:5*5*16] = memory1[i];
    end

    fd = $fopen("C:/Users/24857/Desktop/try/para/layer2.txt", "r");
    for (i=0; i<16; i=i+1) begin
       code = $fscanf(fd, "%h", memory2[i]);
    end
    for (i = 0; i < 16; i = i + 1) begin
            Conv2F[i*5*5*16*6+:5*5*16*6] = memory2[i];
    end

  #(PERIOD/2)
  reset = 1'b0;
  #(PERIOD/2)
  #((7*1457+6*784*6+8+18*22*152 + 6*1600 + 20 + 10000)*PERIOD)
  #(PERIOD*1204) 
  $stop;
  
end

Lenet UUT 
(
	.clk(clk),
	.reset(reset),
	.CNNinput(input_ANN),
	.Conv1F(Conv1F),
	.Conv2F(Conv2F),
	.LeNetoutput(output_ANN)
);

endmodule 